import styled from "styled-components";
import React from "react";

const Container = styled.div.attrs({ className: "flex items-center" })`
  margin-left: auto;
  margin-right: auto;
  width: 100%;

  @media (min-width: 1020px) {
    max-width: 1684px;
    padding-left: 122px;
    padding-right: 122px;
  }

  @media (min-width: 620px) {
    max-width: 1600px;
    padding-left: 80px;
    padding-right: 80px;
  }
`;

const Img = styled.img`
  @media (min-width: 1020px) {
    display: block;
    width: 200px;
    src: "/images/header-logo.svg";
  }
  @media (max-width: 599px) {
    height: 40px;
    display: block;
    src: url(/images/header-logo-small.svg);
  }
  src: url(${props => props.src});
`;
const LargeHeader = () => (
  <Container>
    <a href="/en-ca/" className="flex-grow-10">
      <picture>
        <source media="(max-width: 576px)" srcset="images/header-576.png" />
        <source media="(min-width: 577px)" srcset="images/header-2560.png" />
      </picture>
    </a>
  </Container>
);
export default LargeHeader;
